import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  TrendingUp, 
  Zap, 
  Users, 
  Shield, 
  ArrowRight,
  CheckCircle,
  Star
} from 'lucide-react';

const Home = () => {
  const features = [
    {
      icon: <TrendingUp className="w-8 h-8" />,
      title: "Consultoría Estratégica",
      description: "Estrategia de negocio y planes de crecimiento adaptados a tu industria."
    },
    {
      icon: <Zap className="w-8 h-8" />,
      title: "Automatización de Procesos",
      description: "Optimiza operaciones con soluciones de automatización inteligentes."
    },
    {
      icon: <Users className="w-8 h-8" />,
      title: "Capacitación de Equipos",
      description: "Programas de formación para maximizar el potencial de tu equipo."
    },
    {
      icon: <Shield className="w-8 h-8" />,
      title: "Gestión de Riesgos",
      description: "Identificamos y mitigamos riesgos para proteger tu negocio."
    }
  ];

  const stats = [
    { number: "150+", label: "Proyectos Completados" },
    { number: "50+", label: "Clientes Satisfechos" },
    { number: "95%", label: "Tasa de Éxito" },
    { number: "24/7", label: "Soporte Disponible" }
  ];

  const testimonials = [
    {
      name: "Sarah Johnson",
      role: "CEO, TechStart Inc.",
      content: "LevelUp Consulting transformó nuestros procesos y aumentó nuestra eficiencia en un 40%.",
      rating: 5
    },
    {
      name: "Michael Chen",
      role: "Director de Operaciones, GlobalCorp",
      content: "Sus soluciones de automatización nos ahorraron incontables horas y redujeron costos significativamente.",
      rating: 5
    }
  ];

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <section className="bg-gradient-to-br from-secondary-900 to-secondary-800 section-padding">
        <div className="container-custom">
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
            <motion.div
              initial={{ opacity: 0, x: -50 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
            >
              <h1 className="text-4xl md:text-6xl font-bold text-white mb-6">
                Llevamos tu negocio al siguiente nivel
                <span className="block brand-accent">LevelUp Consulting</span>
              </h1>
              <p className="text-xl text-secondary-300 mb-8">
                Somos especialistas en consultoría de negocios y software de automatización que impulsa
                el crecimiento, la eficiencia y la innovación. Te ayudamos a navegar el futuro digital.
              </p>
              <div className="flex flex-col sm:flex-row gap-4">
                <Link to="/contact" className="btn-primary text-center">
                  Solicita una Consulta Gratis
                </Link>
                <Link to="/services" className="btn-secondary text-center">
                  Explorar Servicios
                </Link>
              </div>
            </motion.div>
            
            <motion.div
              initial={{ opacity: 0, x: 50 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="relative"
            >
              <div className="bg-white rounded-2xl shadow-2xl p-8">
                <div className="space-y-4">
                  <div className="flex items-center space-x-3">
                    <div className="w-3 h-3 bg-green-500 rounded-full"></div>
                    <span className="text-sm text-secondary-600">Panel en Vivo</span>
                  </div>
                  <div className="h-32 bg-gradient-to-r from-accent-500 to-primary-600 rounded-lg"></div>
                  <div className="grid grid-cols-2 gap-4">
                    <div className="h-16 bg-primary-50 rounded-lg"></div>
                    <div className="h-16 bg-secondary-50 rounded-lg"></div>
                  </div>
                </div>
              </div>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="section-padding bg-white">
        <div className="container-custom">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center mb-16"
          >
            <h2 className="text-3xl md:text-4xl font-bold text-secondary-900 mb-4">
              ¿Por qué elegir LevelUp Consulting?
            </h2>
            <p className="text-xl text-secondary-600 max-w-3xl mx-auto">
              Combinamos experiencia en la industria con tecnología de vanguardia para entregar
              soluciones que generan resultados reales de negocio.
            </p>
          </motion.div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
            {features.map((feature, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="card text-center group hover:border-primary-200"
              >
                <div className="w-16 h-16 bg-primary-100 rounded-full flex items-center justify-center mx-auto mb-4 group-hover:bg-primary-200 transition-colors">
                  <div className="text-primary-600">
                    {feature.icon}
                  </div>
                </div>
                <h3 className="text-xl font-semibold text-secondary-900 mb-3">
                  {feature.title}
                </h3>
                <p className="text-secondary-600">
                  {feature.description}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section className="section-padding bg-primary-600">
        <div className="container-custom">
          <div className="grid grid-cols-2 md:grid-cols-4 gap-8 text-center">
            {stats.map((stat, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
              >
                <div className="text-3xl md:text-4xl font-bold text-white mb-2">
                  {stat.number}
                </div>
                <div className="text-primary-100">
                  {stat.label}
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Testimonials Section */}
      <section className="section-padding bg-secondary-50">
        <div className="container-custom">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center mb-16"
          >
            <h2 className="text-3xl md:text-4xl font-bold text-secondary-900 mb-4">
              Lo que dicen nuestros clientes
            </h2>
            <p className="text-xl text-secondary-600">
              No solo lo decimos nosotros: escucha a las empresas que hemos ayudado a transformar.
            </p>
          </motion.div>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {testimonials.map((testimonial, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.2 }}
                className="card"
              >
                <div className="flex items-center mb-4">
                  {[...Array(testimonial.rating)].map((_, i) => (
                    <Star key={i} className="w-5 h-5 text-yellow-400 fill-current" />
                  ))}
                </div>
                <p className="text-secondary-600 mb-4 italic">
                  "{testimonial.content}"
                </p>
                <div>
                  <div className="font-semibold text-secondary-900">
                    {testimonial.name}
                  </div>
                  <div className="text-sm text-secondary-500">
                    {testimonial.role}
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="section-padding bg-secondary-900">
        <div className="container-custom text-center">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
          >
            <h2 className="text-3xl md:text-4xl font-bold text-white mb-6">
              ¿Listos para llevar tu negocio al siguiente nivel?
            </h2>
            <p className="text-xl text-secondary-300 mb-8 max-w-2xl mx-auto">
              Conversemos sobre cómo nuestra consultoría y soluciones de automatización pueden ayudarte
              a alcanzar tus metas y mantenerte a la vanguardia.
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <Link to="/contact" className="btn-primary">
                Comienza tu Camino
                <ArrowRight className="w-5 h-5 ml-2" />
              </Link>
              <Link to="/services" className="btn-secondary">
                Saber Más
              </Link>
            </div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
